import {GET_DATA_PEND, AUTH_ERROR} from '../actions/types'

const DEFAULT_STATE = {
    pends:[],
    pend:{}
}

export default (state = DEFAULT_STATE, action) =>{
    switch(action.type){
        case GET_DATA_PEND:
            console.log('[AuthReducer] got an GET_DATA_PEND action')
            return {...state, pend:action.payload, errorMessage:''}
        case AUTH_ERROR:
            return{...state, errorMessage: action.payload}
            default:
            return state;
    }
}
